import React, { useEffect } from 'react';
import Categorie from './Categorie';
import {interventionList} from '../redux/actions/user.actions';
import axios from 'axios';






function List (){
  //const token = localStorage.getItem('token');

  const test =()=> {
    const token = localStorage.getItem('token');
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': 'Bearer ' + `${token}`
    }
    
    axios.get("http://127.0.0.1:8000/api/interventionList", {
        headers: headers
      })
    .then(res => {
      console.log(res)
    }).catch(err => {
      console.log(err)
    })
  }






   
        return (<div> <Categorie /><div className="col-sm-9 padding-right"> <div>
            <div>
        <div className="review-payment">
          <h2>Intervention</h2>
        </div>
        <div className="table-responsive cart_info">
          <table className="table table-condensed">
            <thead>
              <tr className="cart_menu">
                <td className="image">PC name</td>
                <td className="description"/>
                <td className="price">Prix</td>
                <td className="total">Etat</td>
                <td />
              </tr>
            </thead>
            <tbody>
              <tr>
               
                <td className="car_image">
                  <h4><a>Colorblock Scuba</a></h4>
                 >
                </td>
                <td className="cart_price">
                  <p>$59</p>
                </td>
                <td className="cart_total">
                  <p className="cart_total_price">mezel</p>
                </td>
              </tr>
            </tbody>
          </table>
           <button className="btn btn-primary" onClick={test}>Reparer</button> 
        </div>
      </div>
        </div> </div></div>);
    
}
 
export default List;
